using DataAccess.Objects;
using Newtonsoft.Json;

namespace QuanLyKho
{
    public partial class FormQLNhaCungCap : DevExpress.XtraEditors.XtraUserControl
    {
        NhaCungCapDAL nccDAL = new NhaCungCapDAL();
        NhaCungCapDump nccDump;
        public FormQLNhaCungCap()
        {
            InitializeComponent();
          
        }
        public FormQLNhaCungCap(String idUSer)
        {
            InitializeComponent();
           
            String JSONresult = JsonConvert.SerializeObject(getKhachHangData(idUSer));
            nccDump = JsonConvert.DeserializeObject<List<NhaCungCapDump>>(JSONresult)[0];
            txtTenNhaCungCap.Text = nccDump.TenNhaCungCap;
            txtSoDienThoai.Text = nccDump.SoDienThoai;
            txtGhiChu.Text = nccDump.GhiChu;      
            pictureBox.Image = HamChung.Base64ToImage(Constant.getBase64NoImagePicture());
        }

        private void windowsUIButtonPanelMain_Click(object sender, EventArgs e)
        {

        }
        private DataTable getKhachHangData(String id)
        {
            return nccDAL.getNhaCungCapByID(id);
        }
        private DataTable getAllQuyen()
        {
            return (new QuyenDAL()).GetQuyen();
        }

        private void windowsUIButtonPanelMain_ButtonClick(object sender, DevExpress.XtraBars.Docking2010.ButtonEventArgs e)
        {
            if (e.Button.Properties.Caption.Equals("Lưu")){
                if (nccDump != null)
                {
                    nccDAL.updateNhaCungCap(new NhaCungCapDump(nccDump.IDNhaCungCap, txtTenNhaCungCap.Text, txtSoDienThoai.Text, txtGhiChu.Text));
                    MessageBox.Show("Sửa thành công");
                    backPress();
                }
                else
                {
                    nccDAL.insertNhaCungCap(new NhaCungCapDump( txtTenNhaCungCap.Text, txtSoDienThoai.Text, txtGhiChu.Text));
                    MessageBox.Show("Thêm thành công");
                    backPress();
                }
            }
        }

        private void windowsUIButtonPanelCloseButton_ButtonClick(object sender, DevExpress.XtraBars.Docking2010.ButtonEventArgs e)
        {
            if(e.Button.Properties.Caption == "Back")
            {
                backPress();
            }
        }
        private void backPress()
        {
            this.Controls.Clear();
            FormQLDSNhaCungCap frm = new FormQLDSNhaCungCap();
            frm.Dock = DockStyle.Fill;
            this.Controls.Add(frm);
        }
        private const string userPicture = "";
    }   
}
